(12479, 1, 1, 'Light creates warm and atmosphere in your home. This beautiful light chain from House Doctor consists of 80 small lights on a fine copper chain that are placed with a distance of 10 cm in between each bulb. The warm light and the stunning copper finish add lots of warmth to your home�s d�cor. This item is ideal for a simple Nordic-inspired home with lots of natural elements. Twist the light chain around a beautiful wreath, door or plant. You can also use the lights to create a beautiful and atmospheric table setting. With timer function - Battery not included.<br /><br /><br /> Opis<br /><br />Materiał<br />    Copper.Plastic.LEDbulb<br />Wymiary<br />    10 m. 80 Lys. 10cm betWeen tHe LigHts. battery WitH timer function<br />Kolor<br />    Miedziany<br />', 'Wysyłamy w 2-14 dni', '10-m-copper', '', '', '', '10 m, Copper', '', ''),
