(12555, 1, 1, 'Globe from House Doctor is a beautiful light chain with 15 LED lights. The lights are placed at a distance of 10 cm in between. The light chain uses battery, and is therefore only suitable for inside use. Use it as a cosy light source in your living room or conservatory. You can also achieve a stunning and different effect by placing the light chain in a glass vase. Light chain, Globe, 15 Led lights. Dimension: distance between bulbs: 10 cm, l.: 1.7m. For battery and inside use only.<br /><br /><br /> Opis<br /><br />Wymiary<br />    15 LED LigHt . buLb space10cm. L1.7 m. For battery<br />Kolor<br />    Przezroczysty<br />', 'Wysyłamy w 2-14 dni', 'light-chain-globe-15-led-light', '', '', '', 'Light chain, Globe, 15 LED light', '', ''),
(12605, 1, 1, 'Traditional black/white fabric cord with a wide socket from House Doctor. The cord is 3m long making it possible to hang in many ways. The socket comes with two circulation rings. Note: bulb is not included, but can be bought separately. E27, Bakelite external thread, max 60 Watt, 3m wire<br /><br /><br /> Opis<br /><br />Materiał<br />    Fabric.Plastic<br />Wymiary<br />    E27. Max 60 W. 3.0 m cabLe<br />Kolor<br />    Czarny<br />', 'Wysyłamy w 2-14 dni', 'fabric-wire-w-socket-and-two-rings-black-white', '', '', '', 'Fabric wire w. socket and two rings, Black/White', '', ''),
(12622, 1, 1, 'Kant from House Doctor is a practical cap that you can place on a socket. This beautiful cap is made from brass, which adds a warm and exclusive look to the design. Place the cap on the socket, and you will achieve a light with a new look. Dimension: dia.: 4.5 cm, h.: 11 cm. E27<br /><br /><br /> Opis<br /><br />Materiał<br />    Brass/<br />Wymiary<br />    średnica4.5cm. H11cm<br />Kolor<br />    Złoty<br />', 'Wysyłamy w 2-14 dni', 'socket-cover-kant-brass', '', '', '', 'Socket cover, Kant, Brass', '', ''),
(12655, 1, 1, 'Cap for socket from House Doctor. The cap is called Kant and is made from brass that is plated with a beautiful silver finish lacquer. Place the cap on the socket, and you will immediately achieve a beautiful light with a simple yet modern look. Dimension: dia.: 4.5 cm, h.: 11 cm. E27<br /><br /><br /> Opis<br /><br />Wymiary<br />    średnica4.5cm. H11cm<br />Kolor<br />    Srebrny<br />', 'Wysyłamy w 2-14 dni', 'socket-cover-kant-silver', '', '', '', 'Socket cover, Kant, Silver', '', ''),
(12734, 1, 1, 'Round LED-bulb from House Doctor. Use the bulb together with a socket when you want a lamp with a raw, industrial appeal. Combine bulb and socket with a stunning lampshade, and you will have a beautiful decoration that adds light and warmth to the home. The bulb has wonderful, soft and warm light, and the LED-bulb simultaneously saves you energy and has a longer life. Dimmable, 2 W / E27, Lifespan: 30,000 hours.<br /><br /><br /> Opis<br /><br />Wymiary<br />    L17.5cm. średnica12.5cm. DimmabLe. 2 W/E27. Lifespan30.000 Hours.<br />Kolor<br />    Przezroczysty<br />', 'Wysyłamy w 2-14 dni', 'led-bulb-clear-decoration-clear', '', '', '', 'LED bulb, Clear Decoration, Clear', '', ''),
