(12739, 1, 1, 'White decoration is a beautiful, round LED-bulb from House Doctor. The bulb has a nice white matte colour, which gives you a soft, nice and warm light ﾖ perfect for creating a cosy atmosphere in your home. Use the bulb as a decoration in itself, or together with a decorative socket, or with a nice lampshade to make your own personal light decoration. Dimmable, 2 W/E27, Lifespan: 30,000 hours.<br /><br /><br /> Opis<br /><br />Wymiary<br />    L17.5cm. średnica-12.5cm. dimmabLe. 2 W/E27. Lifespan30.000 Hours.<br />Kolor<br />    Biały<br />', 'Wysyłamy w 2-14 dni', 'led-bulb-white-decoration', '', '', '', 'LED bulb, White Decoration', '', ''),
